import React from "react";
import "./style/App.css";
import 'bootstrap/dist/css/bootstrap.css'; 
import NavBar from './components/NavBar';

const App = () => {
	return (
		<div className="App">
			<NavBar />
			<p>
				Edit <code>src/App.js</code> and save to reload.
			</p>
		</div>
	);
};

export default App;
